css:
.nuclide-breakpoint-icon {
  text-align: center;
  display: block;
  width: 1em;
  color: #555555;
}
.nuclide-breakpoint-icon::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 100%;
  width: 100%;
  height: 100%;
  content: "\f052";
}
.nuclide-current-line-highlight {
  background-color: rgba(0, 152, 255, 0.3);
  border-color: rgba(0, 152, 255, 0.8);
  border-style: solid;
  border-width: 1px 0px;
}
